import React, { Component } from "react";
import { navigate } from "@reach/router";
import SubNav from "./SubNav";
import "../css/GlobalNav.css";
import Design from "./Design";

// const LinkStyle = {
//   color: "#4caf50",
//   textDecoration: "none",
//   textShadow: "1px 1px black"
// };

export default class Menu extends Component {
  componentDidMount() {}

  goDesigns = e => {
    navigate(`/designs`);
  };

  render() {
    return (
      <React.Fragment>
        <SubNav />

        <div>

            <li><button onClick={this.goDesigns}>DESIGN</button></li>
            <button onClick={this.goDesigns}>ILLUSTRATION</button>
            <button onClick={this.goDesigns}>PAINTING</button>
            <button onClick={this.goDesigns}>PHOTOGRAPHY</button>
        </div>
      </React.Fragment>
    );
  }
}
